import React from 'react';
import uuid from 'uuid';
import Bars from './Bars'



export default class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      bar_list: [
        {
          id: uuid.v4(),
          length: 10
        },
        {
          id: uuid.v4(),
          length: 26
        }
      ]
    };
  }
  render() {
    const {bar_list} = this.state;

    return (
      <div>
      <div id="UI_container">
      <div id="bar_container">
      <Bars bar_list={bar_list}/>
      </div>
      </div>

      </div>
    );
  }

}
